public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  RMAppToMonitor other = (RMAppToMonitor) obj;
  if (!this.applicationId.equals(other.getApplicationId())) {
    return false;
  }
  if (this.appTimeoutType != other.getAppTimeoutType()) {
    return false;
  }
  return true;
}
